import React from 'react';
import { Fragment } from "react";
import classes from './Experience.module.css';
import Carossel from './Carossel';
// import image from '../../src/Assets/Rectangle 1.png';

const Experience = () => {

  return (
    <Fragment>
        <div className={classes.container}>
          <div>
            <h2 className={classes.TitleTextStyle}>Experience</h2>
          </div>
          <div className={classes.CarosselContainer}style={{width: 505 *5 }}>
            <Carossel/>
            <Carossel/>
            <Carossel/>
            <Carossel/>
            <Carossel/>
          </div>
          <div>
            <p className={classes.SmallTitleTextStyle}>Skills</p>
          </div>
        </div>
    </Fragment>
  );
};

export default Experience;
